# Paramètres modifiables

# Image utilisée : soit un nom de fichier, soit un entier :
# image = "C:/Chemin/Vers/Image.jpg"
# image = 0 : grille
# image = 1 : plume
# image = 2 : grande vague de Kanagawa (36 vues du mont Fuji)
# image = 3 : image précédente + lignes verticales

image = 3

# Couleurs pour les tracés des images (cmapimg) et spectres (cmapspc) :
# gray (noir et blanc), afmhot, seismic, spectral

cmapimg = "gray"
cmapspc = "seismic"

# Fonction de masquage
#
# m = 0 : filtre passe-bas (profil gaussien)
# m = 1 : filtre passe-haut (profil gaussien)
# m = 2 : filtre passe-bas horizontal (profil gaussien)
# m = 3 : filtre passe-bas vertical (profil gaussien)
# m = 4 : filtre passe-bas (sans apodisation)
# m = 5 : filtre passe-haut (sans apodisation)
# m = 6 : filtre passe-bas horizontal (sans apodisation)
# m = 7 : filtre passe-bas vertical (sans apodisation)
# m = 8 : fréquences horizontales positives
# m = 9 : fréquences verticales positives
# m = 10 : fréquences positives
# m = 11 : supprime certaines fréquences horizontales
# m = 12 : supprime rayures verticales sur image
# m = 20 : correction des défauts dans l'image 3 (avec apodisation)
#          ou suppression des lignes verticales de la grille
# m = 21 : correction des défauts dans l'image 3 (sans apodisation)
#          ou suppression des lignes verticales de la grille

m = 20

# Taille caractéristique du filtre (pour les filtres 0 à 7)

s = 0.1

