# Bibliothèques utilisées

import imageio as iio
import numpy.fft as fft
import matplotlib
import matplotlib.pyplot as plt
import numpy as np

#---------------------------------------------------

# Fonctions de masques

@np.vectorize
def Masque(y, x) :
    if m == 0 :
        return np.exp(-(x*x+y*y)/s**2)
        
    if m == 1 :
        return 1-np.exp(-(x*x+y*y)/s**2)
        
    if m == 2 :
        return np.exp(-(x*x)/s**2)

    if m == 3 :
        return np.exp(-(y*y)/s**2)
    
    if m == 4 :
        return 1.0 if x*x+y*y < s*s else 0.0
        
    if m == 5 :
        return 1.0 if x*x+y*y > s*s else 0.0
        
    if m == 6 :
        return 1.0 if x*x < s*s else 0.0

    if m == 7 :
        return 1.0 if y*y < s*s else 0.0
    
    if m == 8 :
        return  x>=0

    if m == 9 :
        return  y<=0
    
    if m == 10 :
        return x>=0 and y<=0
    
    if m == 11 :
        return np.cos(8*np.pi*x)

    if m == 20 :
        def Mod(x) :
            k = 0.5/8
            return (x+k/2)%k-k/2
        return 1.0-np.exp(-(y*y+4*Mod(x)**2)/0.0025) if x**2.0 > 0.001 else 1.0

    if m == 21 :
        def Mod(x) :
            k = 0.5/8
            return (x+k/2)%k-k/2
        return 0.0 if (y*y < 0.0016 and (Mod(x))**2 < 0.0004 and x*x > 0.0016) else 1.0
    
    return 0.0

