def Switch(tab) :
    """Construit une image en permutant les quatre quadrants
       pour obtenir une image spectrale plus "naturelle" """
    
    nbl, nbc = tab.shape
    
    ntab = tab.copy()
    
    ntab[:nbl//2,:], ntab[nbl//2:,:] = tab[nbl//2:,:], tab[:nbl//2,:]
    ntab[:,:nbc//2], ntab[:,nbc//2:] = ntab[:,nbc//2:], ntab[:,:nbc//2].copy()
    return ntab

