# Détection utilisation hors Pyzo

if '__iep__' not in globals() :
    matplotlib.interactive(False)

# Chargement de l'image 

if isinstance(image, str) :
    img = (iio.imread(image)/255.0).dot(np.array([0.2, 0.5, 0.3]))
elif image == 0 :
    img = np.zeros((128,256), dtype=float)
    img[::16,:] = 1.0
    img[:,::16] = 1.0
elif image == 1 :
    img = np.array(_plume)
elif image == 2 :
    img = np.array(_kanagawa)
elif image == 3 :
    img = np.array(_kanagawa)
    img[:,::16] = 0.0

# Calcul de la TF

itf = Switch(fft.fft2(img))

# Masquage de la TF

itfr = itf.copy()

nbl, nbc = itf.shape

itfr = itf*np.fromfunction(lambda i, j : Masque(i/nbl-0.5, j/nbc-0.5), itf.shape, dtype=float)

# Masquage de la TF inverse

imgr = np.abs(fft.ifft2(Switch(itfr)))

# Tracé des résultats

def Foo(x) :
    return np.log(1.0+np.abs(x))/np.log(nbl*nbc+1)

